import React from 'react';

const Comments = (comments) => {
    return (
        <div style={{ marginTop: "30px" }}>
            {comments.map(com =>
                <div key={com.id}>
                    <h4>email: {com.email}</h4>
                    <p>Комментарий: {com.body}</p>
                </div>
            )
            }
        </div>
    );
};

export default Comments;
